script: |
  super -f text -I q5086.spq | sort > q5086.out

inputs:
  - name: q5086.spq
    data: |
      SELECT + col1 * 18 + col2 * 73 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT col2 NOT IN ( - col0 / col1 + col0, + ( col1 ), - col0 + - col1 / - col2 + col1 + 36 + CAST ( NULL AS INTEGER ) / - col0 - + col0 * + 99 * 98 );
  - name: tab0

outputs:
  - name: q5086.out
    data: |
